import React, { useState, useEffect, useCallback } from 'react';
import WelcomeScreen from './components/WelcomeScreen';
import TestPage from './components/TestPage';
import Results from './components/Results';
import { QUESTIONS } from './data/questions';

// Fisher-Yates shuffle algorithm
const shuffleArray = (array) => {
  const shuffled = [...array];
  for (let i = shuffled.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
  }
  return shuffled;
};

function App() {
  const [currentPage, setCurrentPage] = useState(0); // 0 = welcome, 1-6 = test pages, 7 = results
  const [answers, setAnswers] = useState([]); // Array to store answers by question index
  const [shuffledQuestions, setShuffledQuestions] = useState([]);
  const [debugMode, setDebugMode] = useState(false);

  // Shuffle questions on app load
  useEffect(() => {
    setShuffledQuestions(shuffleArray(QUESTIONS));
  }, []);

  // Keyboard shortcut for debug mode (Ctrl+Shift+D)
  const handleKeyDown = useCallback((event) => {
    if (event.ctrlKey && event.shiftKey && event.key === 'D') {
      event.preventDefault();
      setDebugMode(prev => !prev);
      console.log(`Debug mode ${!debugMode ? 'enabled' : 'disabled'}`);
    }
  }, [debugMode]);

  useEffect(() => {
    document.addEventListener('keydown', handleKeyDown);
    return () => {
      document.removeEventListener('keydown', handleKeyDown);
    };
  }, [handleKeyDown]);

  // Scroll to top helper function
  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  const handleAnswer = (questionIndex, value) => {
    setAnswers(prev => {
      const newAnswers = [...prev];
      newAnswers[questionIndex] = value;
      return newAnswers;
    });
  };

  const handleStartTest = () => {
    setCurrentPage(1);
    setTimeout(scrollToTop, 100);
  };

  const handleNextPage = () => {
    if (currentPage < 6) {
      setCurrentPage(currentPage + 1);
    } else {
      setCurrentPage(7); // Go to results
    }
    setTimeout(scrollToTop, 100);
  };

  const handlePrevPage = () => {
    if (currentPage > 1) {
      setCurrentPage(currentPage - 1);
    } else if (currentPage === 1) {
      setCurrentPage(0); // Go back to welcome screen
    }
    setTimeout(scrollToTop, 100);
  };

  const handleRetakeAssessment = () => {
    setCurrentPage(0);
    setAnswers([]);
    setShuffledQuestions(shuffleArray(QUESTIONS));
    setTimeout(scrollToTop, 100);
  };

  const getProgress = () => {
    if (currentPage === 0) return 0;
    if (currentPage === 7) return 100;
    return (currentPage / 6) * 100;
  };

  const isPageComplete = () => {
    if (currentPage === 0 || currentPage === 7) return true;

    // Check if all questions on current page are answered
    const startIndex = (currentPage - 1) * 9;
    const endIndex = startIndex + 9;

    for (let i = startIndex; i < endIndex; i++) {
      if (answers[i] === undefined) {
        return false;
      }
    }
    return true;
  };

  // Find current question (first unanswered question on current page)
  const getCurrentQuestionIndex = () => {
    if (currentPage === 0 || currentPage === 7) return -1;

    const startIndex = (currentPage - 1) * 9;
    const endIndex = startIndex + 9;

    for (let i = startIndex; i < endIndex; i++) {
      if (answers[i] === undefined) {
        return i;
      }
    }
    return -1; // All questions answered
  };

  if (currentPage === 0) {
    return <WelcomeScreen onStart={handleStartTest} />;
  }

  if (currentPage === 7) {
    return <Results 
      answers={answers} 
      shuffledQuestions={shuffledQuestions} 
      onRetake={handleRetakeAssessment}
    />;
  }

  return (
    <div className="container">
      <div className="card">
        {debugMode && (
          <div style={{
            position: 'fixed',
            top: '20px',
            right: '20px',
            background: '#1f2937',
            color: 'white',
            padding: '10px 15px',
            borderRadius: '8px',
            fontSize: '12px',
            zIndex: 1000,
            fontFamily: 'monospace'
          }}>
            DEBUG MODE ON (Ctrl+Shift+D to toggle)
          </div>
        )}

        <div className="progress-bar">
          <div className="progress-fill" style={{ width: `${getProgress()}%` }}></div>
        </div>

        <div className="page-info">
          Page {currentPage} of 6 | Questions {((currentPage - 1) * 9) + 1}-{currentPage * 9} of 54
        </div>

        <TestPage
          page={currentPage}
          answers={answers}
          onAnswer={handleAnswer}
          shuffledQuestions={shuffledQuestions}
          debugMode={debugMode}
          currentQuestionIndex={getCurrentQuestionIndex()}
        />

        <div className="navigation">
          <button
            className="btn btn-secondary"
            onClick={handlePrevPage}
          >
            {currentPage === 1 ? 'Back to Welcome' : 'Previous'}
          </button>

          <button
            className="btn btn-primary"
            onClick={handleNextPage}
            disabled={!isPageComplete()}
          >
            {currentPage === 6 ? 'See Results' : 'Next'}
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
